import React from "react";
import styles from "./Output.module.css";
import { useSelector } from "react-redux";

const Output = () => {
  const { location, useDTS } = useSelector((state) => state.SendOutputReducer);
  return (
    <div className={styles.output}>
      <input type="text" placeholder="Location" value={location} disabled />
      <input type="text" value="Date" disabled />
      <input type="text" value="Time" disabled />
      <input
        type="text"
        placeholder="The region comes under DTS zone"
        value={
          useDTS
            ? "The region comes under DTS zone"
            : "The region do not come under DTS zone"
        }
        disabled
      />
    </div>
  );
};

export default Output;
